package com.jalsol.travelly.domain.model

import android.graphics.BitmapFactory
import androidx.compose.foundation.Image
import androidx.compose.runtime.Composable
import androidx.compose.ui.Modifier
import androidx.compose.ui.graphics.asImageBitmap
import kotlinx.serialization.Serializable
import kotlin.io.encoding.Base64
import kotlin.io.encoding.ExperimentalEncodingApi

@Serializable
data class Preferences(
    var email: String = "",
    var phone: String = "",
    var firstName: String = "",
    var lastName: String = "",
    var avatarBase64: String = "",
    var loggedIn: Boolean = false
)

@OptIn(ExperimentalEncodingApi::class)
@Composable
fun Base64StringToImage(base64String: String, modifier: Modifier = Modifier) {
    val imageBytes = Base64.decode(base64String)
    val bitmap = BitmapFactory.decodeByteArray(imageBytes, 0, imageBytes.size)
    val imageBitmap = bitmap.asImageBitmap()

    Image(bitmap = imageBitmap, contentDescription = null, modifier = modifier)
}
